import React from 'react';
import './App.css';
//import { Link } from 'react-router-dom';

function Nav() {
    const navStyle = {
        color: 'white'
    };

    return (
        <nav>
            <ul className="nav-links">
                <Link style={navStyle} to="/">
                    <li>Home</li>
                </Link>
                <Link style={navStyle} to="/phonemes">
                    <li>Phonemes</li>
                </Link>
                <Link style={navStyle} to="/morphemes">
                    <li>Morphemes</li>
                </Link>
                <Link style={navStyle} to="/testing">
                    <li>Testing</li>
                </Link>
            </ul>
        </nav>
    );
}
export default Nav;
